import React from "react"
class Form extends React.Component {

    closeForm=()=>{
        alert('ádasd')
    }
    render() {
        
        return (
           
           <div className="panel">
            <div className=" panel_heading " onClick={()=>this.closeForm()}>
                <h3>Thêm Công Việc</h3>
            </div>
            <div className="panel_body">
            <form>
                <div className="form-group">
                    <label >Tên:</label><br />
                    <input type="text" className="form-control" /><br />
                    <label >Trạng thai:</label><br />
                    <select id="inputState" className="form-control">
                        <option>ẩn</option>
                        <option>Hiện</option>
                    </select>

                </div>
                <div className="panel_form_button">
                    <button type="button" className="btn btn-warning">Lưu</button>
                    <button type="button" className="btn btn-danger">Hủy</button>
                </div>
            </form>
            </div>
            </div>
            

        )
    }
}

export default Form





